import React, { useState, useEffect, useContext } from "react";
import { AuthContext } from "./context/AuthContext";
import { Link } from "react-router-dom";
import axios from "axios";
import "./dashboard.css";
import Navigation from "./components/Navigation";

const Dashboard = () => {
  const { currentUser } = useContext(AuthContext);
  const [dashboardData, setDashboardData] = useState({
    totalExpenses: 0,
    spendingChallenge: 0,
    spentThisMonth: 0,
    streak: 0,
    loading: true,
    error: null
  });

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // Get monthly expenses
        const monthlyResponse = await axios.get('/expenses/monthly', {
          headers: {
            Authorization: `Bearer ${currentUser.token}`
          }
        });

        // Get all expenses for total
        const allExpensesResponse = await axios.get('/expenses/all', {
          headers: {
            Authorization: `Bearer ${currentUser.token}`
          }
        });

        // Get user profile for savings goal and streak
        const userProfileResponse = await axios.get('/users/profile', {
          headers: {
            Authorization: `Bearer ${currentUser.token}`
          }
        });

        // Calculate total expenses
        const totalExpenses = allExpensesResponse.data.reduce(
          (sum, expense) => sum + expense.amount, 
          0
        );

        // Get monthly spending
        const spentThisMonth = monthlyResponse.data.totalSpent;

        // Get user's savings goal (spending challenge)
        const spendingChallenge = userProfileResponse.data.savingsGoal || 0;

        // Get user's streak
        const streak = userProfileResponse.data.streak || 0;

        setDashboardData({
          totalExpenses,
          spendingChallenge,
          spentThisMonth,
          streak,
          loading: false,
          error: null
        });
      } catch (error) {
        console.error("Error fetching dashboard data:", error);
        setDashboardData(prev => ({
          ...prev,
          loading: false,
          error: "Failed to load dashboard data"
        }));
      }
    };

    if (currentUser) {
      fetchDashboardData();
    }
  }, [currentUser]);

  if (dashboardData.loading) {
    return <div className="dashboard-loading">Loading dashboard data...</div>;
  }

  return (
    <div className="dashboard-container">
      <Navigation />
      
      <div className="dashboard-header">
        <h1>Dashboard</h1>
        <p>Welcome back, {currentUser.username}!</p>
      </div>

      {dashboardData.error && (
        <div className="dashboard-error">{dashboardData.error}</div>
      )}

      <div className="dashboard-stats">
        <div className="stat-card">
          <h2>Total Expenses</h2>
          <p className="stat-value">${dashboardData.totalExpenses.toFixed(2)}</p>
        </div>

        <div className="stat-card">
          <h2>Spending Challenge</h2>
          <p className="stat-value">${dashboardData.spendingChallenge.toFixed(2)}</p>
        </div>

        <div className="stat-card">
          <h2>Spent This Month</h2>
          <p className="stat-value">${dashboardData.spentThisMonth.toFixed(2)}</p>
          <div className="progress-bar">
            <div 
              className="progress" 
              style={{ 
                width: `${Math.min(100, (dashboardData.spentThisMonth / dashboardData.spendingChallenge) * 100)}%`,
                backgroundColor: dashboardData.spentThisMonth > dashboardData.spendingChallenge ? '#e74c3c' : '#4d6b4d'
              }}
            ></div>
          </div>
          <p className="progress-text">
            {dashboardData.spendingChallenge > 0 
              ? `${Math.round((dashboardData.spentThisMonth / dashboardData.spendingChallenge) * 100)}% of monthly goal`
              : 'No monthly goal set'}
          </p>
        </div>

        <div className="stat-card">
          <h2>Streak</h2>
          <p className="stat-value">{dashboardData.streak} Days</p>
        </div>
      </div>

      <div className="dashboard-actions">
        <Link to="/expenses" className="action-button">
          Log Expenses
        </Link>
        <Link to="/spendinghistory" className="action-button">
          View History
        </Link>
      </div>
    </div>
  );
};

export default Dashboard;
